// Eugene with Split and Reduce
const letterCount_ESR = (str, letter) => {
  const startTime = Date.now();
  const arr = str.split('');
  const calc = (acc, val) => {
    return val === letter ? acc + 1 : acc;
  };
  const result = { time: Date.now() - startTime, count: arr.reduce(calc, 0) };
  return result;
};

// Eugene with RegExp
const letterCount_ER = (str, letter) => {
  const startTime = Date.now();
  const re = new RegExp(`${letter}`);
  let acc = 0;
  for (const i of str) {
    re.test(i) ? acc++ : acc;
  }
  const result = { time: Date.now() - startTime, count: acc };
  return result;
};

